import { BrowserRouter, Route, Link } from "react-router-dom";
import Routes from "../../client/src/routes/routes";
import './App.css'
import { AuthContextProvider } from "./store/auth-context";
function App() {
  return (
    <AuthContextProvider>
    <BrowserRouter>
      <div className="App">
        <div className="container">
          <div className="main">
            <Routes />
          </div>
        </div>
      </div>
    </BrowserRouter>
    </AuthContextProvider>
  );
}

export default App;
